import React, { useState } from 'react';
import styled from 'styled-components';
import { businessSectors, businessAreas } from '../data/businessData';

const Registration = () => {
  const [formData, setFormData] = useState({
    businessSector: '',
    businessArea: '',
  });
  const [step, setStep] = useState(1);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Move to next step or submit data
    if (step === 1 && formData.businessSector) {
      setStep(2);
    } else if (step === 2 && formData.businessArea) {
      console.log('Form submitted:', formData);
      // Here you would typically send the data to your backend
      // and redirect to the next page
    }
  };

  const handleBack = () => {
    setStep(1);
  };

  return (
    <Container>
      <FormCard>
        <Logo>
          <LogoText>Business Diagnosis Tool</LogoText>
        </Logo>

        <ProgressContainer>
          <ProgressStep active={step >= 1}>1</ProgressStep>
          <ProgressLine />
          <ProgressStep active={step >= 2}>2</ProgressStep>
        </ProgressContainer>

        <FormTitle>
          {step === 1 ? 'Select Your Business Sector' : 'Select Your Business Area'}
        </FormTitle>

        <Form onSubmit={handleSubmit}>
          {step === 1 ? (
            <SelectContainer>
              <Select
                name="businessSector"
                value={formData.businessSector}
                onChange={handleChange}
                required
              >
                <option value="">-- Select Business Sector --</option>
                {businessSectors.map((sector) => (
                  <option key={sector.id} value={sector.id}>
                    {sector.name}
                  </option>
                ))}
              </Select>
            </SelectContainer>
          ) : (
            <SelectContainer>
              <Select
                name="businessArea"
                value={formData.businessArea}
                onChange={handleChange}
                required
              >
                <option value="">-- Select Business Area --</option>
                {businessAreas
                  .filter(
                    (area) => 
                      area.sectorId === formData.businessSector || 
                      area.sectorId === 'all'
                  )
                  .map((area) => (
                    <option key={area.id} value={area.id}>
                      {area.name}
                    </option>
                  ))}
              </Select>
            </SelectContainer>
          )}

          <ButtonContainer>
            {step === 2 && (
              <BackButton type="button" onClick={handleBack}>
                Back
              </BackButton>
            )}
            <NextButton type="submit">
              {step === 1 ? 'Next' : 'Start Diagnosis'}
            </NextButton>
          </ButtonContainer>
        </Form>
      </FormCard>
    </Container>
  );
};

// Styled Components
const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  min-height: 100vh;
  background-color: #f5f7fa;
  padding: 20px;
`;

const FormCard = styled.div`
  background: white;
  border-radius: 10px;
  box-shadow: 0 8px 20px rgba(0, 0, 0, 0.05);
  width: 100%;
  max-width: 500px;
  padding: 40px;
`;

const Logo = styled.div`
  text-align: center;
  margin-bottom: 30px;
`;

const LogoText = styled.h1`
  color: #2c3e50;
  font-size: 24px;
  font-weight: 700;
`;

const ProgressContainer = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  margin-bottom: 30px;
`;

const ProgressStep = styled.div`
  width: 30px;
  height: 30px;
  border-radius: 50%;
  background-color: ${props => props.active ? '#3498db' : '#e0e0e0'};
  color: white;
  display: flex;
  align-items: center;
  justify-content: center;
  font-weight: bold;
  transition: background-color 0.3s ease;
`;

const ProgressLine = styled.div`
  height: 3px;
  width: 60px;
  background-color: #e0e0e0;
  margin: 0 10px;
`;

const FormTitle = styled.h2`
  color: #2c3e50;
  font-size: 20px;
  margin-bottom: 25px;
  text-align: center;
`;

const Form = styled.form`
  display: flex;
  flex-direction: column;
`;

const SelectContainer = styled.div`
  margin-bottom: 25px;
`;

const Select = styled.select`
  width: 100%;
  padding: 12px 15px;
  border: 1px solid #dcdfe6;
  border-radius: 5px;
  font-size: 16px;
  color: #2c3e50;
  background-color: white;
  transition: border-color 0.3s;

  &:focus {
    outline: none;
    border-color: #3498db;
  }
`;

const ButtonContainer = styled.div`
  display: flex;
  justify-content: space-between;
`;

const NextButton = styled.button`
  background-color: #3498db;
  color: white;
  border: none;
  border-radius: 5px;
  padding: 12px 25px;
  font-size: 16px;
  cursor: pointer;
  transition: background-color 0.3s;
  flex: ${props => props.fullWidth ? '1' : '0.48'};

  &:hover {
    background-color: #2980b9;
  }
`;

const BackButton = styled.button`
  background-color: #ecf0f1;
  color: #2c3e50;
  border: none;
  border-radius: 5px;
  padding: 12px 25px;
  font-size: 16px;
  cursor: pointer;
  transition: background-color 0.3s;
  flex: 0.48;

  &:hover {
    background-color: #dcdfe6;
  }
`;

export default Registration;
